import {createMuiTheme} from '@material-ui/core/styles';


const theme = createMuiTheme({
    typography: {
        useNextVariants: true, 
        fontFamily: [
            'Roboto, Arial',
            '"Bebas Neue"'
    ]
    },
    palette: {
        primary: {
            main: '#ffff',

        },
        secondary: {
            main: '#f50057',
        },
        background:{
            default: "#ffff"
        },
        type: "dark"
    },
    shape: {
        borderRadius: 10
    }
    
});

export default theme;
